$(document).on("click",".delete-question-modal",function(){let e=$(this);Swal.fire({title:"Sil!",text:"Silmek istediğinize emin misiniz?",imageUrl:"/assets/media/svg/illustrations/23.svg",imageWidth:400,imageHeight:200,imageAlt:"Custom image",animation:!0,confirmButtonClass:"btn btn-light-primary font-weight-bold",cancelButtonClass:"btn btn-transparent-danger font-weight-bold",confirmButtonText:"Sil",cancelButtonText:"İptal",showCancelButton:!0}).then(i=>{if(i.isConfirmed){let a=e.data("question-uuid"),n="/admin/dashboard/surveys/questions/destroy";axios.delete(n,{data:{question_uuid:a}}).then(t=>{t.status===200&&(success(t),$("#questions_datatable").DataTable().ajax.reload())}).catch(t=>{error(t)})}})});
